package com.ajie.wechat.model;

import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.Id;
import javax.persistence.Table;

@Entity
@Table(name = "JT_ORG_MAPPING")
public class JtOrgMapping {
	
	@Id
//	@GeneratedValue(strategy = GenerationType.IDENTITY)//如果这行不写，则需要保存时手动生成主键
	@Column(name = "ORG_MAPPING_ID")
	private String orgmappingid;
	
	@Column(name = "JT_ORG_CODE")
	private String jtorgcode;
	
	@Column(name = "JT_ORG_NAME")
	private String jtorgname;
	
	@Column(name = "JT_PARENT_ORG_CODE")
	private String jtparentorgcode;
	
	@Column(name = "JT_PARENT_ORG_NAME")
	private String jtparentorgname;
	
	@Column(name = "IS_LEAF")
	private String isleaf;
	
	@Column(name = "REMARK")
	private String remark;
	
	@Column(name = "LAST_UPDATE_TIME_STAMP")
	private String lastupdatetimestamp;
	
	@Column(name = "ORG_ID")
	private String orgid;
	
	@Column(name = "ORG_NAME")
	private String orgname;
	
	@Column(name = "MAPPING_REMARK")
	private String mappingremark;
	
	@Column(name = "LAST_UPDATE_ID")
	private String lastupdateid;
	
	@Column(name = "LAST_UPDATE_NAME")
	private String lastupdatename;
	
	@Column(name = "LAST_UPDATE_TIME")
	private String lastupdatetime;

	public String getOrgmappingid() {
		return orgmappingid;
	}

	public void setOrgmappingid(String orgmappingid) {
		this.orgmappingid = orgmappingid;
	}

	public String getJtorgcode() {
		return jtorgcode;
	}

	public void setJtorgcode(String jtorgcode) {
		this.jtorgcode = jtorgcode;
	}

	public String getJtorgname() {
		return jtorgname;
	}

	public void setJtorgname(String jtorgname) {
		this.jtorgname = jtorgname;
	}

	public String getJtparentorgcode() {
		return jtparentorgcode;
	}

	public void setJtparentorgcode(String jtparentorgcode) {
		this.jtparentorgcode = jtparentorgcode;
	}

	public String getJtparentorgname() {
		return jtparentorgname;
	}

	public void setJtparentorgname(String jtparentorgname) {
		this.jtparentorgname = jtparentorgname;
	}

	public String getIsleaf() {
		return isleaf;
	}

	public void setIsleaf(String isleaf) {
		this.isleaf = isleaf;
	}

	public String getRemark() {
		return remark;
	}

	public void setRemark(String remark) {
		this.remark = remark;
	}

	public String getLastupdatetimestamp() {
		return lastupdatetimestamp;
	}

	public void setLastupdatetimestamp(String lastupdatetimestamp) {
		this.lastupdatetimestamp = lastupdatetimestamp;
	}

	public String getOrgid() {
		return orgid;
	}

	public void setOrgid(String orgid) {
		this.orgid = orgid;
	}

	public String getOrgname() {
		return orgname;
	}

	public void setOrgname(String orgname) {
		this.orgname = orgname;
	}

	public String getMappingremark() {
		return mappingremark;
	}

	public void setMappingremark(String mappingremark) {
		this.mappingremark = mappingremark;
	}

	public String getLastupdateid() {
		return lastupdateid;
	}

	public void setLastupdateid(String lastupdateid) {
		this.lastupdateid = lastupdateid;
	}

	public String getLastupdatename() {
		return lastupdatename;
	}

	public void setLastupdatename(String lastupdatename) {
		this.lastupdatename = lastupdatename;
	}

	public String getLastupdatetime() {
		return lastupdatetime;
	}

	public void setLastupdatetime(String lastupdatetime) {
		this.lastupdatetime = lastupdatetime;
	}
	
}
